import React from 'react';
import NavBar from './components/navbar'
import Counters from './components/counters';
import './App.css';

function App() {
  return (
    <React.Fragment>
    <NavBar>
      <main>
        <Counters/>
      </main>
    </NavBar>
    </React.Fragment>
  );
}

export default App;
